            <div  >
                <button style={{margin:'20px' , backgroundColor:'lightgray' , border:'2px solid black'}}> <Link to='/'>Home  </Link></button>
                <button style={{margin:'20px' , backgroundColor:'lightgray'}}> <Link to='/add'>Add ToDo  </Link></button>
                <button style={{margin:'20px', backgroundColor:'lightgray'}}> <Link to='/comments'>List  </Link></button>
            </div>
        </div>
    )
}
